__NUXT_JSONP__("/overmij", (function(a,b,c,d){return {data:[{story:{name:"Over mij",created_at:"2021-05-27T08:12:06.361Z",published_at:c,id:52886975,uuid:"8618084b-464d-4110-8075-d732e9f56400",content:{_uid:"e3e3952f-c665-4e9b-9730-45016fe3b437",image:[{id:2363189,alt:b,name:b,focus:a,title:b,filename:"https:\u002F\u002Fa.storyblok.com\u002Ff\u002F115739\u002F720x1024\u002Ffc9da92f2e\u002Fovermij.png",copyright:b}],title:"WELKOM, \nIK BEN HANNE",review:[{_uid:"d2910c60-238e-42d6-9b6f-30933f3f307e",columns:[{_uid:"a684ac44-55d4-4304-a257-9fe7cec58ded",review:"We hebben met ons 6-jarig zoontje een traject met Hanne gevolgd om hem te helpen met zijn boosheid en voor ons om beter te kunnen begrijpen waar zijn boosheid vandaan komt. Het vertrouwen in Hanne is zowel vanuit ons, maar ook vooral vanuit ons zoontje heel snel opgebouwd. Hanne heeft een hele prettige en fijne manier van praten, aanwezig zijn in een ruimte en verbinding maken. We merkten dit aan de openheid van ons zoontje naar haar toe. Hanne bespreekt de \"moeilijke\" onderwerpen met een kind op een speelse en visuele manier. We hebben het traject als prettig en hulpvol ervaren.",persoon:"-Vanessa, moeder van Teun (6 jaar)",component:d,_editable:"\u003C!--#storyblok#{\"name\": \"review\", \"space\": \"115739\", \"uid\": \"a684ac44-55d4-4304-a257-9fe7cec58ded\", \"id\": \"52886975\"}--\u003E"},{_uid:"514ef40d-e34e-40fa-a1db-dce61d0d9477",review:"Hanne maakt gemakkelijk contact, is betrokken en boekt snel resultaat! Onze dochter was heel angstig. Hanne heeft onze dochter handvatten geboden door middel van oefeningen en gesprekken om met haar angsten om te gaan en deze te overwinnen. Ook als ouders ontvingen wij verschillende adviezen. Dit heeft ons enorm geholpen! Onze dochter kan nu beter met haar angst omgaan en zit weer goed in haar vel.",persoon:"-Alike, moeder van Anna (7 jaar)",component:d,_editable:"\u003C!--#storyblok#{\"name\": \"review\", \"space\": \"115739\", \"uid\": \"514ef40d-e34e-40fa-a1db-dce61d0d9477\", \"id\": \"52886975\"}--\u003E"}],component:"Grid",_editable:"\u003C!--#storyblok#{\"name\": \"Grid\", \"space\": \"115739\", \"uid\": \"d2910c60-238e-42d6-9b6f-30933f3f307e\", \"id\": \"52886975\"}--\u003E"}],content:"Ik ben Hanne van Willigenburg, moeder van 3 kids (2 jongens & een meisje). Samen met Floris woon ik in een prachtig oud pand in Amsterdam.\n\nMijn roots liggen in Voorschoten (Zuid-Holland). Toen ik 18 was ben ik uitgevlogen naar Enschede om Toegepaste Onderwijskunde te studeren. Aan het einde van mijn studie ben ik in Amsterdam geland en nooit meer weggegaan.\n\nVoordat ik mijn eigen kindercoachpraktijk POWER2Kids ben gestart heb ik jaren gewerkt als consultant in het bedrijfsleven. Het moment dat ik zelf kinderen kreeg is bij mij het zaadje gepland om kindercoach te worden. 3 kinderen later is mijn eigen praktijk een feit en ben ik op de juiste plek. Het is op mijn lijf geschreven om kinderen te begeleiden die een steuntje in de rug kunnen gebruiken. Soms is er een aanwijsbare reden waarom een kind niet lekker in zijn vel zit. Soms ook niet. Samen gaan we aan de slag om te ontdekken wat er is en hoe we dit kunnen beetpakken. Nieuwsgierig geworden? Neem vrijblijvend contact met me op.",component:"Over-mij",sub_title:"Kindercoach. Rouwdeskundige. Moeder.",_editable:"\u003C!--#storyblok#{\"name\": \"Over-mij\", \"space\": \"115739\", \"uid\": \"e3e3952f-c665-4e9b-9730-45016fe3b437\", \"id\": \"52886975\"}--\u003E"},slug:"over-mij",full_slug:"over-mij\u002F",sort_by_date:a,position:0,tag_list:[],is_startpage:true,parent_id:52886974,meta_data:a,group_id:"18eb9a7b-3a91-4e06-a642-8b62bd2525da",first_published_at:c,release_id:a,lang:"default",path:a,alternates:[],default_full_slug:a,translated_slugs:a},cv:1623138045,rels:[],links:[]}],fetch:{},mutations:void 0}}(null,"","2021-06-07T17:13:13.794Z","review")));